import React from 'react';
import './index.css'; 
import Deletebutton from "../button/Deletebutton.js"
const ListInfo = () => {
  return (
    <div className="float-bloc-list">
    <div className="greet" >
        <div className="title">Insérer une nouvelle catégorie</div>
        <div className="subtitle">Soyez inspirés donnez nous un nom!</div>
    </div>
    <div className="list-info">
      <div className="plant-image">
        <img src="/assets/plant.jpg" alt="Plant" />
      </div>
      <div className="plant-name">Nom de la plante</div>
      <div className="info">Une info</div>

      <Deletebutton/>
    </div>
    </div>
  );
};

export default ListInfo;
